import React from 'react'

export default function EmptyBlock({wordLength}:any) {
    const inputFields = [];

    for (let i = 1; i <= wordLength; i++) {
      inputFields.push(
        <input key={i} type="text" value={i} readOnly />
      );
    }

  return (
    <div>
    {[...Array(wordLength)].map((_, index) => (
      <input key={index} type="text" value="" readOnly />
    ))}
  </div>
  )
}
